import React from "react";
import AAA from 'src/Media/AAA.png'
const index =() =>{
    return(
        <div className="Header">

            <div className="header__logo">
                <img src={AAA} alt="" />
                <span>Drive</span>
            </div>
            <div className="header__searchContainer"></div>
            <div className="header__icons"></div>
        </div>
    )
}

export default index
